import React, { useEffect, useState } from "react";

const ShowTbale = () => {
  const [userData, setuserData] = useState([]);
  useEffect(() => {
    const dt = localStorage.getItem("register");

    console.log(dt);
    setuserData(dt)
  }, []);
  return (
    <>
      <h1>ShowTbal</h1>
      <table class="table table-dark">
        <thead>
          <tr>
            <th scope="col">ID</th>
            <th scope="col">NAME</th>
            <th scope="col">EMAIL</th>
            <th scope="col">AGE</th>
            <th scope="col">MOBILE</th>
            <th scope="col">GENDER</th>
            <th scope="col">CITY</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <th scope="row">1</th>
            <td>Mark</td>
            <td>Otto</td>
            <td>@mdo</td>
            <td>Otto</td>
            <td>@mdo</td>
            <td>Otto</td>
            <td>@mdo</td>
          </tr>
        </tbody>
      </table>
    </>
  );
};

export default ShowTbale;
